import React from 'react';
import './css/About.css';
import lonelyfox from './static/nateshim.jpg';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import Link from '@material-ui/core/Link';
import Typography from '@material-ui/core/Typography';
import Avatar from '@material-ui/core/Avatar';
import {withStyles, createStyles} from '@material-ui/styles';
import StyledProps from './StyledProps';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';

const Navigation = (props: StyledProps) => {
  const classes = props.classes;
  return (   
    <AppBar position="sticky">
      <Container>
        <Toolbar disableGutters>
          <Box className={classes.logoContainer}>
            <Avatar alt="Lonely Fox" src={lonelyfox}></Avatar>
            <Typography variant="h3" className={classes.text}>Nathanael Shim</Typography>
          </Box>
          <Box>
            <Link href="/" variant="h3" className={classes.text}> About </Link>
            <Link href="/projects" variant="h3" className={classes.text}> Projects </Link>        
            <Link href="/music" variant="h3" className={classes.text}>Music</Link>
          </Box>
        </Toolbar>
      </Container>
    </AppBar> 
  );
}

const useStyles = createStyles({
  navBar: {
    display: 'flex',
    flexDirection: 'row',
    backgroundColor: '#F7F3F2',
    alignItems: 'center',
    padding: '4rem 0',

  },
  text: {
    fontFamily: 'Colombo',
    color: '#12130F',
  },
  backgroundContainer: {
    backgroundSize: 'cover',
    height: '100%',
    width: '100%',
    backgroundPosition: 'center',
  }
});

export default withStyles(useStyles)(Navigation);
